<!-- Le contenu habituel de votre page ici ... --> <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/js/bootstrap.bundle.min.js\" integrity=\"sha384-w76AqPfDkMBDXo30jS1Sgez6pr3x5MlQ1ZAGC+nuZB+EYdgRZgiwxhTBTkF7CXvN\" crossorigin=\"anonymous\"> </script>\n</body> Vous pouvez maintenant bÃ©nÃ©ficier de certains Ã©lÃ©ments de Bootstrap qui nÃ©cessitent ces fonctionnalitÃ©s Javascript, et ce sans saisir de code Javascript supplÃ©mentaire (sauf si nÃ©cessaire). C'est par exemple le cas des barres de navigation et des menus dÃ©roulants. Copiez la page page_bootstrap3.html vers page_bootstrap4.html. C'est sur ce nouveau document que vous travaillez dÃ©sormais. Votre page inclue dÃ©jÃ  le fichier CSS de Bootstrap. Vous devez maintenant inclure la bibliothÃ¨que Javascript requises (Bootstrap.js) dans votre page comme montrÃ© dans l'extrait de code prÃ©cÃ©dent. Rendez-vous sur la page de documentation des barres de navigation : https://getbootstrap.com/docs/5.3/components/navbar/ Essayer d'inclure une barre de navigation noire contenant les entrÃ©es suivantes : Accueil, Partenaires, Contact et Ã€ propos (ce sont les mÃªmes intitulÃ©s que dans le TP3) ainsi qu'un Ã©lÃ©ment permettant d'effectuer une recherche. Fiez-vous aux exemple de la documentation de Bootstrap. Cette barre de navigation devra Ãªtre responsive , lorsque la largeur de l'Ã©cran est infÃ©rieure Ã  992px, elle doit disparaÃ®tre au profit de l'Ã©lÃ©ment qui permet de la dÃ©plier (voir exemple ci-dessous). Vous pouvez Ã©galement chercher dans la documentation comment faire en sorte que l'Ã©lÃ©ment de recherche et son bouton forment un groupe comme sur le screenshot ci-dessous (ce n'est Ã  priori pas le comportement que vous avez par dÃ©faut mais bootstrap propose des classes permettant de faire Ã§a facilement). Largeur d'Ã©cran: 1250px RÃ©sultat en largeur extra-large Largeur d'Ã©cran: 620px RÃ©sultat en largeur small Si vous avez rÃ©ussi avec succÃ¨s les questions prÃ©cÃ©dentes c'est que vous